34.	OPERATIONAL TRANSACTIONS

34.1	Seller may buy, sell and/or borrow or tender gas for return at a later date (an "Operational Transaction") as necessary to:  

      (i)	maintain system pressure and line pack;

      (ii)	manage system imbalances;

      (iii)	perform other operational functions of Seller in connection with its storage services; or

      (iv)	otherwise protect the operational integrity of Seller's system.

	Operational Transactions will be made at locations where the gas may be most operationally needed from time to time.  Operational Transactions will have a lower priority than firm service.

34.2	Seller will post its quantities for sale, borrow or tender for bidding on its electronic bulletin board in accordance with the applicable bidding provisions which will be posted at the time of the Operational Transaction offer. Seller reserves its right, in its sole discretion,

      (i)	to withdraw its postings;

      (ii)	reject all bids due to operational changes; and

      (iii)	reject any bids which do not meet or which contain modifications to the terms of the posting or which contain terms that are operationally unacceptable.

34.3	Seller will file a report on or before March 1 of each year reflecting the Operational Transactions for the 12-month period ending the preceding December 31.  The report will indicate:

      (i)	whether the Operational Transaction was a purchase, sale, borrow or tender;

      (ii)	the source of the gas in the Operational Transaction;

      (iii)	the date of the Operational Transaction (for borrows and tenders, Seller will include the beginning and termination date of the transaction);

      (iv)	volumes;

      (v)	the Operational Transaction price, expressed as a rate per dekatherm;

      (vi)	the costs and revenues from the Operational Transaction;

      (vii)	the disposition of the associated costs and revenues, including their absorption by Seller;

      (viii)	an explanation of the purpose of any Operational Transaction; and

      (ix)	whether Seller exercised its rights under Sections 34.2(i) and (ii) to withdraw postings or reject bids for Operational Transactions.

3.	REQUESTS FOR SERVICE 

3.1	Request for Service Form.  Valid requests for new or increased levels of service under any of Seller's Rate Schedules shall be made by submitting to Seller a fully-completed Request for Service Form in the form included in this Tariff and by otherwise complying with all of the provisions of this Section 3.  Requests for amended Service Agreements shall be made on a form provided or approved by Seller.  The completed request for amended Service Agreements shall be forwarded to Seller through Seller's EBB, or other method of delivery approved by Seller.  A Customer or prospective Customer seeking new or increased service from Seller, including a prospective bidder for released capacity under the provisions of Section 13 of the General Terms and Conditions, is referred to as "Requestor" in this Section 3.

3.2	Credit Data.  

	(a)	Except as provided in Section 3.2(b), Requestor shall submit with its completed Request for Service Form the following credit evaluation data:

	(1)	a copy of Requestor's audited financial statements and financial reports for the previous two (2) fiscal year ends certified by the Chief Financial Officer or Chief Accounting Officer of the Requestor prepared in accordance with generally accepted accounting principles or, for non U.S. based Requestors, prepared in accordance with the equivalent standards.  The certificate must state that the financial statements and financial reports fairly present the financial condition and results of operations of the Requester for the period it covers;

	(2)	a copy of Requestor's most recent Annual Report and, if applicable, most recent Forms 10-Q and 10-K; provided that if Requestor has no Annual Report or Forms 10-Q or 10-K it must provide:

	(i)	its financial statement for the most recent period available, which may be unaudited but if unaudited, must be signed and attested to by Requestor's President and Chief Financial Officer as fairly representing the financial condition of the company; 

	(ii)	any current filings with other regulatory agencies that discuss Requestor's financial condition; and 

	(iii)	a detailed business description that includes Requestor's corporate form, the number of years or months it has been in business, the nature of its business, and the number of its employees;

      (3)	a list of Requestor's affiliates, including any parent and subsidiary companies;

      (4)	the names, addresses and telephone numbers of three trade references with whom Seller may make reasonable inquiry into Requestor's creditworthiness, and copies of any available reports from credit reporting and bond rating agencies. The results of reference checks and any credit reports submitted must show that Requestor's obligations are being paid on a reasonably prompt basis;

	(5)	names, addresses, and telephone numbers of bank references;

	(6)	disclosure of past or pending bankruptcy or other similar state or federal proceedings, outstanding judgments or pending claims or lawsuits that could affect the solvency of Requestor; 

	(7)	written confirmation that Requestor is not operating under any chapter of the Bankruptcy Code and is not subject to liquidation or debt reduction procedures under State Laws, such as an assignment for the benefit of creditors, or any informal creditors' committee agreement. Seller may make an exception for a Requestor who is a debtor in possession operating under Chapter XI of the Federal Bankruptcy Act if Seller is adequately assured that the service billing will be paid promptly as a cost of administration under the Federal Court's jurisdiction;

	(8)	a list of owners and/or shareholders of Requestor, if Requestor is privately held; and

	(9)	any other data Requestor desires to submit that would assist Seller in determining creditworthiness.

	(b)	Seller may waive the requirements of all or any part of Section 3.2 on a nondiscriminatory basis.  A Requestor that is an existing Customer on Seller's system shall not be required to provide the information required by Section 3.2(a) in order to make a new request for service, provided, however, that Seller may require an existing Customer to furnish any information necessary to make a creditworthiness determination with respect to that Customer/Requestor's new request for service.  

	(c)	In lieu of submitting all or any part of the data required by this Section 3.2, a Requestor that has submitted such data to Seller within the past twelve months may certify that all or any part of such data has not changed in any manner material to creditworthiness and update items that have materially changed.

3.3 	Advance Determination of Creditworthiness.  A Requestor shall submit the data required in this Section 3, at least 15 business days before bidding for or requesting new or increased service for an advance determination of creditworthiness by Seller.

3.4	Deficient Requests.  Seller shall promptly notify a Requestor whose request for service has been rejected because of Requestor's failure to satisfy the provisions specified in this Section 3.  Such notice shall identify the deficiencies that must be corrected in order to make a valid request to Seller.  

3.5	Material Changes.  If any information provided by Requestor pursuant to this Section materially changes, Requestor shall provide Seller with prompt written notification of such changes.Requestor is required to provide written notice to Seller within two (2) days of filing a report (other than an annual or quarterly report) with the Securities and Exchange Commission ("SEC") or other equivalent foreign regulatory body that Requestor is required to file as a result of a material event or corporate change affecting its financial condition.  That notice shall include a general description of the nature and reason for the filing and to the extent that the report is not available electronically, Requestor shall provide Seller with a copy of the report.  Requestors that are not subject to SEC reporting requirements, but have a parent that is, shall comply with respect to any such filings by their parent.

3.6	Denial of Requests.  Seller may reject any request for service from a Requestor that fails to meet Seller's creditworthiness requirements unless Requestor provides assurance of payment as provided in Section 3.7 below.  Grounds for rejection shall include, but shall not be limited to, Requestor's failure (a) to show that Requestor's obligations are being paid in a timely manner, or (b) to provide reasonable assurance that Requestor will be able to continue to pay its obligations in the future.

3.7	Assurance of Payment.  If Seller denies a request for service due to a failure to satisfy Seller's creditworthiness requirements, Requestor may obtain service if it provides Seller with assurance of payment in the manner set forth at Section 9 (Operating Conditions) of the General Terms and Conditions and otherwise complies with the ongoing creditworthiness requirements set forth in Section 9.  If Requestor fails to tender such assurance of payment within the time period set forth in Section 9.5(c) of General Terms and Conditions, or such longer time period reasonably established by Seller, Seller may deny Requestor's request for service or reject any bid submitted by Requestor.

3.8	Execution of Service Agreement.  Following the approval of a request for service and the award of service by Seller, Seller and Requestor shall enter into a new or amended Service Agreement under each appropriate Rate Schedule in accordance with the provisions of Section 5 of the General Terms and Conditions.  If Requestor fails to execute such Service Agreement within 15 days after Seller tenders it to Requestor, or within such other time period agreed to by Seller or required by a specific provision of this Tariff, Requestor's request for service and Seller's offer of service shall be void and of no further force or effect.  Service shall not commence until Requestor returns or transmits an executed electronic or paper Service Agreement to Seller in compliance with the provisions of the Tariff.  Seller may waive the provisions of this subsection on a nondiscriminatory basis.

3.9	Record Retention.  Seller shall maintain records of all valid requests for service and their disposition for a period of three years from the date of receipt of those requests.  Seller shall not disclose such information, including information relating to bids for service, other than pursuant to the provisions of this Tariff, a Commission proceeding or valid court order.

13.	RELEASE AND ASSIGNMENT OF SERVICE RIGHTS

13.1	Capacity Release and Assignment Procedures


	(a)	The procedures set forth in this Section governing the release and assignment of service rights by Customers shall apply to service under Rate Schedule HSS. An HSS Customer may release and assign all or any portion of the service under its Service Agreement.  Any Customer accepting such assignment ("Replacement Customer") must meet the Seller's creditworthiness requirements, must have executed an Electronic Contracting Agreement with Seller, and must be an authorized EBB user complying with all conditions and requirements set forth in the General Terms and Conditions and in the applicable Rate Schedule and Service Agreement.

	(b)	The capacity release timeline is applicable to all parties involved in the capacity release process; however, it is only applicable if 1) all information provided by the parties to the transaction is valid and the acquiring Customer has been determined to be credit worthy before the capacity release bid is tendered,  2) for index-based capacity release transactions, the Releasor has provided Customer with sufficient instructions to evaluate the corresponding bid(s) according to the timeline, and 3) there are no special terms or conditions of the release.  In addition, Customer may complete the capacity release process on a different timeline if the offer includes unfamiliar or unclear terms and condition (e.g., designation of an index not supported by Customer).


      (c)	Capacity Release Timeline:

For biddable releases (1 year or less):

      (1)	offers should be tendered such that they can be posted by 9:00 a.m. on a Business Day;

      (2)	open season ends at 10:00 a.m. on the same or a subsequent Business Day; 

      (3)	evaluation period begins at 10:00 a.m. during which any contingencies are eliminated, determination of best Bid is made, and ties are broken;

      (4)	if no match is required, the evaluation period ends and the Award is posted by 11:00 a.m.;

      (5)	where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the Award is posted by 12:00 Noon;

      (6)	the Service Agreement is issued within one hour of the Award posting (with a new contract number, when applicable); 

      (7)	nomination is possible beginning at the next available nomination cycle for the effective date of the Service Agreement.

      For biddable releases (more than 1 year):

      (8)	offers should be tendered such that they can be posted by 9:00 a.m. on a Business Day;

      (9)	open season shall include no less than three 9:00 a.m. to 10:00 a.m. time periods on consecutive Business Days;

      (10)	evaluation period begins at 10:00 a.m. during which any contingencies are eliminated, determination of best bid is made, and ties are broken;

      (11)	if no match is required, evaluation period ends and the Award is posted by 11:00 a.m.;

      (12)	where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the Award is posted by 12:00 Noon;

      (13)	the Service Agreement is issued within one hour of the Award posting (with new Service Agreement number, when applicable); 

      (14)	nomination is possible beginning at the next available nomination cycle for the effective date of the Service Agreement.

      For non-biddable releases:

      (15)	the posting of prearranged deals that are not subject to bid are due no later than one hour prior to the nomination deadline for the applicable cycle. The posting deadlines are:

(i)	Timely Cycle			12:00 Noon
(ii)	Evening Cycle			5:00 p.m.
(iii)	Intraday 1 Cycle		9:00 a.m.
(iv)	Intraday 2 Cycle		1:30 p.m.
(v)	Intraday 3 Cycle		6:00 p.m.; 

      (16)	the Service Agreement is issued within one hour of Award posting (with a new Service Agreement number, when applicable); 

      (17)	nomination is possible beginning at the next available nomination cycle for the effective date of the Service Agreement.

13.2	Initiating the Release and Assignment.

	(a)	Electronic Bulletin Board.  The release and assignment of service rights by Customer shall be facilitated through Seller's Electronic Bulletin Board (EBB), described at Section 2 (Electronic Bulletin Board) of the General Terms and Conditions.  As explained below, Customers seeking to release and assign firm service rights (Releasors) shall post offers to release and notices of prearranged assignments through Seller's EBB.  Potential Replacement Customers also may post offers to purchase service rights and bids for capacity through Seller's EBB.  Such postings shall be made through the interactive features of Seller's EBB and shall remain posted for at least 30 days. Seller reserves the right to request modifications in, or to delete all or any portion of, postings that do not conform to the requirements of Section 13.2(b) below; provided, however, that Seller shall have no responsibility for any errors, omissions, or other aspects of these postings from third parties on its EBB.

	(b)	Release Notice.  Releasor may initiate the assignment of the service rights it is seeking to release and assign by electronically transmitting the information specified below to Seller's EBB (Release Notice).  Such electronic Release Notice shall contain the following information regarding the capacity that Customer is seeking to release:

      (1)	releasor's identity, the Rate Schedule under which Releasor seeks to release capacity, and the Service Agreement number assigned by Seller to the Service Agreement under which Customer seeks to release capacity;

      (2)	whether release is on a temporary or permanent basis;

      (3)	the numeric quantity being released on a per day basis for storage injection and storage withdrawal, a per-release quantity for storage capacity, and the term (duration);

	(4)	the receipt and delivery points;

      (5)	any applicable recall provisions relating to the proposed release, and whether the Replacement Customer will have the option to refuse the capacity after recall has ended;

      (6)	any minimum conditions concerning the rate, term, or volume that the releasing Customer is willing to accept (and that Releasor wishes to have posted on Seller's EBB), or a statement that it has separately revealed to Seller any such minimum conditions, which shall be posted following the close of bidding;

      (7)	whether Releasor will accept contingent bids for the capacity being released and, if so, all terms and conditions of acceptable contingencies including the manner in which such contingent bids will be evaluated;

      (8)	the maximum reservation charge (including demand-type surcharges) applicable to the capacity being released;

      (9)	the date and time of (i) the posting of the release notice on Seller's EBB, and (ii) the close of the bidding for the released capacity;

      (10)	whether the Releasor has a prepackaged arrangement to assign the service to a specified Replacement Customer; and, if so, the identity, address, and telephone number of the designated Replacement Customer and the price the prospective Replacement Customer has agreed to pay under any such prepackaged arrangement;

      (11)	objective criteria for evaluating responsive bids by potential Replacement Customers and for breaking ties among highest bidders, to the extent that Releasor's criteria are at variance with the criteria established by Seller in this Section;

      (12)	the name, and Internet E-mail address or EDI/EDM Electronic Notice Delivery Mechanism of Releasor's designated contact person; 

      (13)	the rate basis on which bids for the released capacity are to be submitted;

      (14)	for non-indexed base releases, whether bids for the released capacity are to be submitted on a fixed dollars and cents amount or on a percentage of maximum rate basis; 

      (15)	for index-based releases, whether there is a rate floor, any applicable rate default to be used when the index-based formula is not available or cannot be computed, and which of the following methods is acceptable:  (a) a percentage of the formula; (b) a dollars and cents differential from the formula; (c) a dollars and cents differential from the rate floor; or (d) an approved method in Customer's tariff, if any;

      (16)	whether the release is subject to an indemnification provision pursuant to which the initial Replacement Customer indemnifies Releasor against any claims by successive Replacement Customers relating to refunds (where Releasor has provided correctly calculated refunds to the initial Replacement Customer), and all terms of any such indemnification provision; 

      (17)	whether the release is to an asset manager, as defined in Section 284.8 of the Commission's regulations; and

      (18)	whether the release is to a marketer participating in a state-regulated retail access program as defined in Section 284.8 of the Commission's regulations.

	(c)	Evaluation Criteria. 

      (1)	General Requirements.  For the capacity release business process timing model, only the following methodologies are required to be supported by Seller and provided to Releasor as choices from which they may select and, once chosen, should be used in determining the awards from the bid(s) submitted. They are: 1) highest rate, 2) net revenue and 3) present value.  Other choices of bid evaluation methodology (including other Releasor defined evaluation methodologies) can be accorded similar timeline evaluation treatment at the discretion of Seller.  However, Seller is not required to offer other choices or similar timeline treatment for other choices, nor, is Seller held to the timeline should Releasor elect another method of evaluation.  Releasor shall include all such alternative evaluation criteria in the Release Notice to be posted on Seller's EBB.  When Seller makes awards of capacity for which there have been multiple bids meeting minimum conditions, Seller shall award the bids, best bid first, until all offered capacity is awarded.

      (2)	Index-Based Releases.  For index-based capacity release transactions, the Releasor should provide the necessary information and instructions to support the chosen methodology.  Where the result of an award under an index-based release is to be applied on a monthly basis and the formula detailed in the capacity release award requires calculations on a daily basis, the results of such daily calculations may exceed the maximum daily reservation rate or be less than the applicable minimum daily reservation rate.  Any resulting monthly reservation rate may not be less than the rate floor specified in the release, if applicable.  If the resulting monthly reservation is less than the rate floor, the rate floor will be used for invoicing.  Except for releases with a term of one year or less, the resulting monthly reservation rate may not exceed the applicable monthly maximum recourse rate.  For releases with a term of more than one year, if the resulting monthly reservation rate exceeds the applicable maximum recourse rate, the maximum recourse rate will be used for invoicing.  For index-based capacity release transactions, the Releasing Shipper shall provide the necessary information and instructions to support the chosen methodology.

	(d)	At any time up to the close of the bidding period for the posted capacity, Releasor may withdraw its posting for release of capacity unanticipated circumstances justify the withdrawal and no minimum bid has been made.  Such a withdrawal shall be affected by Releasor placing a notice of withdrawal on Seller's EBB.  Offers will be binding until a written or electronic notice of withdrawal is received by Seller.

	(e)	Seller may refuse to allow a permanent release if it has a reasonable basis to concluded that it will not be financially indifferent to the release.  If Seller denies Customer's request to permanently release capacity, Seller will notify Customer via E-mail and include in the notice the reasons for the denial.

13.3	Posting.

	Posting of Release Notices on Seller's EBB shall be complete and subject to the conditions and exceptions set forth below.

	(a)	Posting for purposes of inviting bids shall not be required for (i) prepackaged arrangements Releasor has arranged with a designated Replacement Customer for a period of 31 days or less; (ii) prepackaged arrangements for more than one (1) year that Releasor has arranged with a designated Replacement Customer under which the designated Replacement Customer agrees to pay the maximum reservation charge and commodity rate, and applicable surcharges, and meets all requirements set forth in this Tariff; (iii), releases to an asset manager, as defined in Section 284.8 of the Commission's regulations; or (iv) releases to a marketer participating in a state-regulated retail access program as defined in Section 284.8 of the Commission's regulations (collectively "exempt transactions").  There shall be no maximum price cap for pre-packaged arrangements of one (1) year or less in length.  Pre-packaged arrangements for more than 31 days but one (1) year or less in length are not exempt transactions under this Section 13.3(a).  For cross-month releases, the maximum duration for eligibility as an exempt transaction under part (i) above shall be 31 days.  The rate received by Releasor under prearranged transactions of more than one (1) year that are exempt from the ordinary posting and competitive bidding procedures set forth in this Section 13 must not exceed the maximum rate.

	(b)	Notice to Seller; Informational Posting.  For any exempt transaction, as described in paragraph (a) immediately above, Releasor shall provide Seller, for Service Agreement execution purposes, and shall post on Seller's EBB in accordance with the capacity release timeline under Section 13.1(c) above:  (i) the information required for a Release Notice; (ii) the price and term of the assignment; (iii) the identity of the Replacement Customer; and (iv) for releases to an asset manger (as defined in Section 284.8 of the Commission's regulations), the asset manager's delivery obligation to Releasor.  Releasor may post such exempt transactions at any time.  Seller shall issue an Assignment Agreement within one (1) hour of such posting and shall allow nominations under such Assignment Agreement in the next available nomination cycle, as specified in Section 6.2(e) of the General Terms and Conditions.  In the event Customer has not executed the Assignment Agreement prior to making its nomination, Customer shall be deemed to have executed the Assignment Agreement with Seller pursuant to which the nomination is being made.   

	(c)	Limitations on Continuation of Exempt Transactions.  A Releasor that has employed an exempt transaction to assign service to a designated Replacement Customer for a period of 31 days or less, as described in Section 13.3(a)(i) above:  (i) shall not roll over, extend, or otherwise continue that release beyond its original term without complying with the ordinary posting and competitive bidding requirements applicable to all non-exempt transactions, as set forth in this Section, unless the rollover, extension, or continuation is at the maximum rate for a term of more than one (1) year, meets all of the terms and conditions of the Release Notice, and qualifies as an exempt transaction under Section  13.3(a) above; and (ii) shall not, pursuant to the short-term exemption of Section 13.3(a)(i), re-release to the same Replacement Customer for 28 days after termination of the earlier release period without fully complying with the ordinary posting and competitive bidding requirements applicable to all non-exempt transactions, as set forth in this Section, unless the re-release is for more than one (1) year at the maximum rate, meets all of the terms and conditions of the Release Notice, and qualifies as an exempt transaction under Section 13.3(a) above.  This Section does not apply to releases to an asset manger or releases to a marketer participating in a state-regulated retail access program.

	(d)	Timing and Duration of Posting.  Offers by potential Releasors to release and assign capacity shall be posted on Seller's EBB in accordance with the capacity release timeline under Section 13.1(c) above. Releasor may not specify an extension of the original bid period or the pre-arranged deal match period without posting a new release.

	(e)	Method to Post.  Seller shall post offers and bids, including prearranged deals, upon receipt.  Releasor may request a later posting time for posting of such offer, and Seller shall support such request insofar as it comports with the standard capacity release timeline specified in NAESB WGQ Standard No. 5.3.2.

13.4	Bidding.

	(a)	Potential Replacement Customers shall submit bids for released capacity which comport with the methodology of the release notice stated in ten-thousandths of one dollar ($0.0000) per Dth one day per month for reservation charges, or in hundredths of one cent (0.00?) per Dth for one-part volumetric rate bids or a percent of maximum, accompanied by a valid Bid for capacity release Form in the form included in this Tariff.  Potential Replacement Shippers may bid the maximum applicable reservation rate as an alternative to the method specified by the Releasor, except when the release is index-based for a term of one year or less or utilizes market-based rates.  Bids submitted for a permanent release shall be submitted on a valid Request for Service as set forth in Section 3 (Requests for Service) of the General Terms and Conditions.    Such bids (i) shall be submitted electronically by potential Replacement Customers to Seller's EBB in the format established by Seller for such bids on the EBB, (ii) shall be displayed on the EBB when complete without revealing the identity of the bidder during the bidding period, and (iii) in accordance with Seller's specifications, shall specifically reference the capacity for which the bid is being submitted.

      (b)	A potential Replacement Customer responding to the posting of a Release Notice shall be permitted to bid a quantity and a term of service different from those specified in the posted Release Notice; provided, however, that a Bidder shall not be permitted to bid a quantity or a term of service less than any minimum quantity or term disclosed and posted by Releasor in the Release Notice.  Bidders must accept all other conditions set forth in the Release Notice.

	(c)	Bids shall be submitted by potential Replacement Customers without bidders knowing the identities of other bidders.  Bidders may submit multiple bids, each higher than the previous bid, during the posting period established pursuant to Section 13.3(e). 

	(d)	All bidders must: (i) have prequalified under Seller's creditworthiness standards  and (ii) where execution of an Assignment Agreement will be required within five days of its transmission by Seller, have executed an Electronic Contracting Agreement with Seller, as required by Section 3 (Requests for Service), Section 9 (Operating Conditions), and Section 5 (Service Agreement and Electronic Contracting) of the General Terms and Conditions.  

	(e)	Releasors that have multiple Service Agreements with Seller may post Release Notices for capacity under such Service Agreements with a "Stand-Alone" or "Not Stand Alone" indicator.  Potential Replacement Customers must submit bids on all parcels that "Stand Together".

	(f)	All bids for capacity release transactions of more than one (1) year in length shall neither exceed the maximum rates nor be less than the minimum rates permitted by the Commission for the released services. Bids for capacity release transactions of one (1) year or less shall not be less than the minimum rates permitted by the Commission for the released services.  Bids for capacity for a term of more than one (1) year that are offered at a one-part volumetric rate (which shall apply only to the reservation portion of the rate) shall not exceed a maximum rate calculated by converting the applicable maximum reservation charge into a volumetric charge at a 100 percent load factor plus the applicable commodity charges. 

	(g)	Bids are binding, other than contingent bids, until notice of withdrawal is received by Transporter's EBB.  Bids may be withdrawn before the close of the bidding period but may not be withdrawn after the bid period ends.  Any bidder that withdraws its bid for released capacity may not, within that same bidding period, submit a bid at a lower rate for any portion of that same capacity.

	(h)	Where higher bids are received for capacity that Releasor proposes to release under a prepackaged arrangement that is subject to competitive bidding (including prepackaged arrangements for 31 days or less for which Releasor requests competitive bidding), the Replacement Customer designated by Releasor (designated Replacement Customer) shall be notified by Seller and shall exercise its right to match the highest competing bid in accordance with the capacity release timeline under Section 13.1(c) above. A Releasor shall not be able to specify an extension of the original pre-arranged match period without posting a new release.

13.5	Evaluation of Bids and Assigning Service Rights.

	(a)	Seller shall perform the evaluation of bids in accordance with the criteria specified in the Release Notice and shall determine which, if any, bids to accept.  

	(b)	In the absence of any such Releasor-developed alternative criteria to the contrary, as specified in Releasor's Release Notice, bids shall be evaluated and rights to released capacity assigned by Seller in accordance with the bid evaluation criteria referenced at Section 13.2(c).

	(c)	Where Releasor has posted a prepackaged arrangement that is subject to competitive bidding(including prepackaged arrangements for 31 days or less for which the Releasor requests competitive bidding), the designated Replacement Customer under that arrangement will be awarded the capacity if, within the time limits specified in Section 13.4(h), that designated Replacement Customer matches the competing bid(s) offering the highest economic value, as calculated in accordance with the bid evaluation criteria set forth in Section 13.2(c) or in the Release Notice.

	(d)	Where highest bids of equal value are received for released capacity from more than one bidder, not including a designated Replacement Customer under a prepackaged arrangement, the capacity (i) shall be assigned in accordance with any nondiscriminatory method for breaking ties established by Releasor in the Release Notice, or (ii) shall, if Releasor does not establish a tie-breaking method, be assigned pro rata on the basis of the respective quantities bid by the winning bidders.  Bidders may specify in their bids the minimum quantities they will accept.  If a pro rata allocation would result in assignment of quantities below a bidder's minimum quantity, any such bidder will not be assigned the capacity, and the total quantity available for assignment will then be re-allocated among the remaining highest value bidders on a pro rata basis.

	(e)	Seller shall post on the EBB the winning bid and the identity of the winning bidder(s) in accordance with the capacity release timeline under Section 13.1(c) above.  

13.6	Assignment Agreements.

	(a)	For all transactions pursuant to this Section 13, Seller shall electronically transmit an Assignment Agreement upon receipt of Replacement Customer's electronic confirmation reflecting the terms of the Release Notice to Replacement Customer in accordance with the capacity release timeline under Section 13.1(c) above.

	(b)	Seller and Replacement Customer shall execute the Assignment Agreement in substantially the form contained in this Tariff; provided that such an Agreement shall be executed electronically where an executed Agreement is required within five business days of its transmission by Seller.  That Assignment Agreement shall contain all terms and conditions of the release and assignment; provided that such terms and conditions are identical to those set forth in the underlying Release Notice.  Where electronic contracting is required as described immediately above, all Replacement Customers must have executed an Electronic Contracting Agreement in accordance with the electronic contracting procedures specified in Section 5.7 of the General Terms and Conditions.  All Replacement Customers must meet the Seller's creditworthiness requirements.  Service will not be provided unless the Assignment Agreement properly has been executed.  If the Replacement Customer does not execute and return such Assignment Agreement within two business days of Seller's tender (or such later date established by Releasor through notice to Seller and Replacement Customer), the bid and Seller's offer of an Assignment Agreement shall be void and Seller will tender an Assignment Agreement to the next highest acceptable bidder, if any, consistent with the terms of the Release Notice.  Except with respect to prearranged transactions described in Section 13.3(a) above, Replacement Customers failing to return such agreement shall prohibited from bidding for six months, or less than six months if agreed to in writing by the Releasor.  Nothing herein shall restrict Releasor from pursuing any other remedies it may have against a Replacement Customer failing to execute and return an Assignment Agreement tendered by Seller.

13.7	Implementation.  Following acceptance of a bid for assignment and execution of an Assignment Agreement, Replacement Customers may submit nominations to Seller in the next available nomination cycle, as specified in Section 6.2(e) of the General Terms and Conditions.  In the event Customer has not executed the Assignment Agreement prior to making its nomination, Customer will be deemed to have executed the Assignment Agreement with Seller pursuant to which the nomination is being made.    Quantities under assigned service rights shall have the same priority as those quantities had under the applicable underlying Service Agreement originally entered into by Releasor and Seller, and that priority shall be unaffected by whether or not the assignment is subject to recall, as described at Section 13.8 below.

13.8	Recall; Reassignment of Assigned Service Rights.

	(a)	Agreements Subject to Recall.  Releasors shall be permitted to specify as a condition for releasing capacity the right to recall that assigned capacity upon notice to Seller and to Replacement Customer.  Any such recall provision must be included in the Release Notice originally submitted by Releasor and in the Assignment Agreement executed following assignment of the capacity.  The Release Notice and the Assignment Agreement governing the assigned capacity shall clearly state (i) the frequency with which Releasor may recall any released capacity, (ii) the maximum duration of any such recall, (iii) whether and under what conditions any right of first refusal held by Releasor is transferred to Replacement Customer, and (iv) such other terms as Releasor may specify.  Replacement Customer shall be permitted to make secondary assignments of all or any part of the capacity, unless prohibited by the Releasor, contained in its Assignment Agreement that is subject to Releasor's right to recall, provided, however, that such assignments shall not vary the recall provisions contained in the original assignment. 

      (b)	Replacement Customer Release.  A Replacement Customer that desires to release some or all of its assigned capacity (Replacement Customer/Secondary Releasor) may release and reassign all or a portion of the assigned capacity to other parties (Secondary Replacement Customers) subject to the requirements set forth in paragraph (a) immediately above.  Any such reassignment must satisfy all of the posting, bidding and notice requirements set forth in this Section, and any Secondary Replacement Customer must satisfy all of the creditworthiness and other requirements set forth in this Section.  No limitation unless required by the Releasor shall be placed on the number of times service rights that are not subject to recall may be reassigned, provided, however, that a Replacement Customer/Secondary Releasor may not assign rights any greater than the rights it received pursuant to the earlier assignment, and may not place any unreasonable or discriminatory conditions on such assignments.

	(c)	For all released capacity subject to recall rights, the following recall notification periods shall apply:

      Timely Recall Notification:

      (1)	Releasor recalling capacity shall provide notice of such recall to the Seller and the first Replacement Customer no later than 8:00 a.m. on the day that Timely Nominations are due;

      (2)	Seller shall provide notification of such recall to all affected Replacement Customers no later than 9:00 a.m. on the day that Timely Nominations are due;

      Early Evening Recall Notification:

      (3)	Releasor recalling capacity shall provide notice of such recall to the Seller and the first Replacement Customer no later than 3:00 p.m. on the day that Evening Nominations are due;

      (4)	Seller shall provide notification of such recall to all affected Replacement Customers no later than 4:00 p.m. on the day that Evening Nominations are due;

      Evening Recall Notification:

      (5)	Releasing Customer recalling capacity shall provide notice of such recall to the Seller and the first Replacement Customer no later than 5:00 p.m. on the day that Evening Nominations are due;

      (6)	Seller shall provide notification of such recall to all affected Replacement Customers no later than 6:00 p.m. on the day that Evening Nominations are due;

      Intraday 1 Recall Notification:

      (7)	Releasor recalling capacity shall provide notice of such recall to the Seller and the first Replacement Customer no later than 7:00 a.m. on the day that Intraday 1 Nominations are due;

      (8)	Seller shall provide notification of such recall to all affected Replacement Customers no later than 8:00 a.m. on the day that Intraday 1 Nominations are due;


Intraday 2 Recall Notification:

      (9)	Releasor recalling capacity shall provide notice of such recall to the Seller and the first Replacement Customer no later than 12:00 p.m. on the day that Intraday 2 Nominations are due;

      (10)	Seller shall provide notification of such recall to all affected Replacement Customers no later than 1:00 p.m. on the day that Intraday 2 Nominations are due.

Intraday 3 Recall Notification:

      (11) 	Releasor recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 4:00 p.m. on the day that Intraday 3 Nominations are due;

      (12) 	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 5:00 p.m. on the day that Intraday 3 Nominations are due.

      For recall notification provided to Seller prior to the recall notification deadline specified above and received between 7:00 a.m. and 5:00 p.m., Seller shall provide notification to all affected Replacement Customers no later than one hour after receipt of such recall notification.  For recall notification provided to Seller after 5:00 p.m. and prior to 7:00 a.m., Seller shall provide notification to all affected Replacement Customers no later than 8:00 a.m. after receipt of such recall notification.  Recalled capacity notices will indicate whether penalties will apply for the Gas Day for which quantities are being reduced due to a capacity recall.

	(d)	For the recall notification provided to Seller, the quantity shall conform to Seller's capacity recall notification specification.  Seller requires that the quantity must be expressed in terms of adjusted total released capacity entitlements based upon the Elapsed Prorated Capacity.  Seller will not be obligated to deliver in excess of the total daily contract quantity of the release.

	(e)	Assignment Agreements that call for payment by Customer of a one-part volumetric rate may not be released and assigned.

	(f)	If a Releasor's Service Agreement is suspended or terminated, then Seller may terminate the release of capacity to the Replacement Customer if Seller has first provided the Replacement Customer an opportunity to continue receiving service by paying the lesser of (i) the Releasor's Service Agreement rate; (ii) the applicable Recourse Rate; or (iii) some other rate that is acceptable to Seller.

	(g)	If a Replacement Customer's Service Agreement is suspended or terminated, then the released capacity will revert to the Releasor.


13.9	Billing.

	(a)	Seller, in accordance with the terms of this Tariff, shall:  (i) bill the Releasor for the full reservation charge, applicable reservation-related surcharges and any other fixed charges for which Releasor is otherwise obligated to Seller, less either the reservation charge bid by Releasor's Replacement Customer or the reservation charge portion of amounts billed to Replacement Shippers paying one-part volumetric rates; and (ii) bill the Replacement Customer for (A) the reservation charge bid by that Replacement Customer (except for periods during which the Releasor has recalled the capacity), (B) all commodity charges, or all payments under one-part volumetric rates, and any minimum volumetric commitment agreed to but not met by the Replacement Shipper, (C) any commodity surcharges, (D) any penalties or HSCQ balance correction costs associated with the assigned capacity, and (E) any applicable overrun charges, as any of these charges may change from time to time upon approval of the Commission.  For all payments received from Replacement Customer, Seller shall allocate such payment first to the reservation charge (or to the reservation charge components under a one-part rate) and then any amounts above that level to the commodity charge or to the commodity charge component under a one-part rate). Replacement Customer may, upon notice to Seller and approval of the Releasor, appoint Releasor as its agent to receive such billings from Seller.  The charges shall be pro-rated for a Billing Month if necessary. 

      (b)	For all assignments of service rights, Releasor shall remain ultimately responsible to Seller for full payment of the reservation charge, any applicable reservation-related surcharges, and any other fixed charges for which Releasor is otherwise obligated to Seller. If Releasor proposes a Permanent Release of its capacity, Seller will agree to discharge the Releasor of its obligations on a prospective basis in whole or in part provided (i) the Replacement Customer meets the requirements in Section 9.5 of these General Terms and Conditions, (ii) Seller would be financially indifferent, as determined by Seller in its reasonable discretion, to the discharge if such discharge is granted, and (iii) Seller's lenders agree to such discharge.  Until payment by Replacement Customer to Seller of any unpaid reservation charges, any claims Releasor may have relating to those charges shall be subordinated to those of Seller.  Any reservation charge payments made by Replacement Customer to Seller will not be withheld from Releasor by Seller due to Replacement Customer's failure to pay Seller other amounts owed that are unrelated to the released capacity.  In the event of termination of Releasor's Service Agreement with Seller, Replacement Customer's Service Agreement with Seller is deemed terminated unless (1) Replacement Customer agrees to pay Seller the currently effective maximum rates for service under the Tariff, or (2) Seller and Replacement Customer mutually agree upon a discounted rate or negotiated rate for service under this Tariff; provided, however, that any Replacement Customer shall be entitled to continued service at the contract rate between the Releasor and Seller.

	(c)	In the event that a Replacement Customer (including a Secondary Replacement Customer) fails to pay Seller's invoice relating to the released capacity, Seller shall within five business days provide the Releasor (the most recent Releasor, where the capacity has been secondarily assigned) with written or telephonic notice of such nonpayment.  Upon Releasor's receipt of such notice of Replacement Customer's nonpayment, Releasor, without prejudice to any other rights it may have, may immediately recall the assigned capacity upon 24-hour notice to Replacement Customer unless within such period Replacement Customer pays in full the outstanding indebtedness, together with accrued interest at the Commission approved interest rate, and furnishes adequate assurance of payment to Releasor if required by Releasor.  

13.10	Refunds.

	(a)	For all refunds other than those described at paragraph (b) immediately below, the original Releasor of any capacity shall receive from Seller any reservation charge-related refunds associated with the assigned capacity including any refunds related to the reservation charge portion of payments under a one-part volumetric rate. The Replacement Customer holding the assigned right to service at the time of the overpayment shall receive from Seller its share of any commodity charge-related refunds, including any refunds related to the commodity portion of payments under a one-part volumetric rate, associated with the assigned capacity.  Refunds owed by Seller will be made by Seller directly to Replacement Customer or indirectly through the Releasor if Replacement Customer has appointed Releasor as its agent for billings pursuant to Section 13.9(a) above.  

	(b)	The refund obligation of Seller set forth in paragraph (a) shall be modified where Releasor has released capacity at a rate in excess of that owed by Releasor to Seller for that capacity (Releasor's Margin).  To the extent that Releasor's Margin equals or exceeds the amount of any refund obligation, Seller shall not be obligated to make refunds to Releasor.  Any refunds ultimately paid to a Replacement Customer in that event shall be paid by Releasor.

13.11	Fees.  Seller shall not charge a fee for posting of a Release Notice or a Request to Purchase on its EBB.  Seller shall be entitled to charge a reasonable fee if Releasor and Seller agree that Seller shall receive a fee for actively marketing the capacity Releasor seeks to release.

13.12	Term.  The term a Releasor imposes may not conflict with any provision of the Service Agreement, Rate Schedule or General Terms and Conditions of Seller's Tariff. In the event of such conflict, Seller may withdraw the Customer's notice from posting.

13.13	Termination.  If the Releasor fails to pay any monthly bill in accordance with the provisions of its Service Agreement and of Section 10 of the General Terms and Conditions, the Service Agreement at issue shall terminate and the capacity under contract by that Releasor shall revert back to Seller. Any Service Agreement(s) of a Replacement Customer(s) for such capacity shall terminate as well.
